body:
@noumanqaiser:
>if the format is the opset you are referring to.

Yep, that's it, and this model uses ONNX operator set 10 (<= 12), ruling out *one* common problem we've seen recently where models are exported from various frameworks using opset 13, which causes fallback to the CPU. If this was WinML or ONNX Runtime, I'd recommend setting the input tensor size in the SessionOptions (WinML [LearningModelSessionOptions.OverrideNamedDimension](https://docs.microsoft.com/en-us/uwp/api/windows.ai.machinelearning.learningmodelsessionoptions.overridenameddimension?view=winrt-20348) or ORT [AddFreeDimensionOverride](https://github.com/microsoft/onnxruntime/blob/master/include/onnxruntime/core/session/onnxruntime_c_api.h)), but I'm not seeing any familiar API's above, and so this must all be going through "Microsoft CustomVision" which I'm not familiar with and don't know what it's calling under the hood. 🤔 This will take some research and asking around...

@fdwr  Just wanted to check if there is an update regarding this, is there something I could do to get the CustomVision exported ONNX model to utilize  GPU via DirectML. 

If it would help, I would be happy to share the project/trained model file/sample images seperately.

Looking forward to hearing from you.

@fdwr I have shared with you a .Net project with the actual ONNX model and sample Images. The project runs mass inferencing and measures the average time for each inference.

https://drive.google.com/drive/folders/1DqnUvTaU9xp2QLuV_X9jFCjkratckMYL?usp=sharing

Looking forward to hear from you.
